import React from 'react';
import { Route } from 'react-router-dom';
// import { CacheRoute } from 'react-router-cache-route';

// 异步按需加载component
function asyncComponent(getComponent) {
  return class AsyncComponent extends React.Component {
    static Component = null;
    state = { Component: AsyncComponent.Component };

    componentDidMount() {
      const { Component } = this.state;
      if (!Component) {
        getComponent().then(({ default: asyncdefaultComponent }) => {
          AsyncComponent.Component = asyncdefaultComponent;
          this.setState({ Component: asyncdefaultComponent });
        });
      }
    }
    render() {
      const { Component } = this.state;
      if (Component) {
        return <Component {...this.props} />;
      }
      return null;
    }
  };
}

function load(component) {
  return import(`./pages/${component}`);
}

const TicTacToe = asyncComponent(() => load('TicTacToe'));
const GoodsShow = asyncComponent(() => load('GoodsShow'));

export default function Router() {
    return (
        <>
        <Route path="/TicTacToe" exact render={props => <TicTacToe {...props} />} />
        <Route path="/GoodsShow" exact render={props => <GoodsShow {...props} />} />
        </>
    );
}
